module.exports = {
  env: {
    browser: true,
    es2021: true
  },
  extends: ["eslint:recommended"],
  overrides: [
    {
      env: {
        node: true
      },
      files: [".eslintrc.{js,cjs}"],
      parserOptions: {
        sourceType: "script"
      }
    }
  ],
  parserOptions: {
    ecmaVersion: "latest",
    sourceType: "module"
  },
  rules: {
    "comma-dangle": "error",
    "curly": ["error", "multi-line"],
    "getter-return": "off",
    "no-console": "off",
    "no-duplicate-imports": ["error"],
    "no-multi-spaces": ["error", { "exceptions": { "VariableDeclarator": true }}],
    "no-multiple-empty-lines": ["error", { "max": 2 }],
    "no-self-assign": ["error", { "props": false }],
    "no-trailing-spaces": ["error"],
    "no-unused-vars": ["error", { argsIgnorePattern: "_*" }],
    "no-useless-escape": "off",
    "no-var": ["error"],
    "prefer-const": ["error"],
    "semi": ["error", "never"]
  },
  globals: {
    test: true,
    setup: true
  }
}

import { devices } from "@playwright/test"

const config = {
  projects: [
    {
      name: "chrome",
      use: {
        ...devices["Desktop Chrome"],
        contextOptions: {
          timeout: 60000
        },
        hasTouch: true
      }
    },
    {
      name: "firefox",
      use: {
        ...devices["Desktop Firefox"],
        contextOptions: {
          timeout: 60000
        },
        hasTouch: true
      }
    }
  ],
  browserStartTimeout: 60000,
  retries: 2,
  testDir: "./src/tests/",
  testMatch: /(functional|integration)\/.*_tests\.js/,
  webServer: {
    command: "yarn start",
    url: "http://localhost:9000/src/tests/fixtures/test.js",
    timeout: 120 * 1000,
    // eslint-disable-next-line no-undef
    reuseExistingServer: !process.env.CI
  },
  use: {
    baseURL: "http://localhost:9000/"
  }
}

export default config

import resolve from "@rollup/plugin-node-resolve"

import { version } from "./package.json"
const year = new Date().getFullYear()
const banner = `/*!\nTurbo ${version}\nCopyright © ${year} 37signals LLC\n */`

export default [
  {
    input: "src/index.js",
    output: [
      {
        name: "Turbo",
        file: "dist/turbo.es2017-umd.js",
        format: "umd",
        banner
      },
      {
        file: "dist/turbo.es2017-esm.js",
        format: "es",
        banner
      }
    ],
    plugins: [resolve()],
    watch: {
      include: "src/**"
    }
  }
]

import { esbuildPlugin } from '@web/dev-server-esbuild'
import { playwrightLauncher } from '@web/test-runner-playwright'

/** @type {import("@web/test-runner").TestRunnerConfig} */
export default {
  browsers: [
    playwrightLauncher({
      product: 'chromium',
      launchOptions: {
        timeout: 60000
      }
    }),
    playwrightLauncher({
      product: 'firefox',
      launchOptions: {
        timeout: 60000
      }
    }),
    playwrightLauncher({
      product: 'webkit',
      launchOptions: {
        timeout: 60000
      }
    })
  ],
  browserStartTimeout: 600000,
  nodeResolve: true,
  files: "./src/tests/unit/**/*_tests.js",
  testFramework: {
    config: {
      ui: "tdd"
    }
  },
  plugins: [
    esbuildPlugin({ ts: true, target: "es2020" })
  ]
}
